import React from "react";

const url = "https://image.tmdb.org/t/p/w500/A0knvX7rlwTyZSKj8H5NiARb45.jpg";

export const Card_Movie = () => {
  return (
    <div className="container w-60 rounded-lg px-5 overflow-hidden shadow-2xl">
      <img src={url} alt="asd" className="" />
    </div>
  );
};

export default Card_Movie;
